import math
from sympy import isprime
def get_ulam_distance(n):
  if n == 1:
    return 0
  return math.floor((math.sqrt(n - 1) + 1) / 2)
def generate_sequence(limit):
  sequence = []
  for num in range(2, limit):
    if not isprime(num):
      dist = get_ulam_distance(num)
      if isprime(dist):
        sequence.append(num)
  return sequence
